import React, { useState, useEffect } from "react";

const Repos = ({ url }) => {
    const [commits, setCommits] = useState('')

    useEffect(() => {
        (async() => {
            const result = await fetch(url)
	        const repos = await result.json()

            setCommits(repos)
        })()
    }, [url])

    return(
        <div>
            <h3>Los commits son:</h3>
            {commits.length > 0 ? 
            (<div>
                {commits.map(repository => 
                    <div>
                        <h4>{repository.name}</h4>
                        <a href = {repository.html_url}>See on Github</a>
                        <button onClick= { getReady(repository.commits_url.slice(0, -6)) } >See commits!</button>
                        {console.log(url)}
                    </div>)}
            </div> 
            )
            :
            <p>El usuario no tiene repositorios</p>
            }
        </div>
    )
}


export default Repos
